import React from 'react';

function PracticeTodo(){
    const arr = [1,2,3,4,5];
  return(
    <div>
      <h2>Basic of React js</h2>
      <ul>
      {
        arr.map((val,i)=>{
          return(
            <li key={i} style={{padding:'50px'}}>at index {i} value is {val} </li>
          )
        })
      }
        
      </ul>
      
    </div>
  )
}

export default PracticeTodo
